sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statusCode == '200') {
        try {
            outputs.user = JSON.parse(inputs.responseBody).user;
        } catch (e) {
            gs.info("Encountered an error while parsing");
            throw new Error('Encountered an error. Check logs for more details. ' + e);
        }
    } else {
        var err = x_1143793_pd.PagerDuty_Utils.get4xx5xxErrMsg(inputs.statusCode);
        throw err;
    }
})(inputs, outputs);

